query:
query containerIpAddressRangeTestFromURL ( $accountId:ID! $testContainerFromUrlInput:TestContainerFromUrlInput!) {
	container ( accountId:$accountId ) {
		ipAddressRange {
			testFromURL ( input:$testContainerFromUrlInput   ) {
				sizeValid
				topValid
				sizeInvalid
				topInvalid
			}
		}
	}	
}
